import React from "react";
import Anasayfa from "./components/anasayfa";
import "./App.css";
const App = () => {
  return (
    <div className="App">
      <div className="banner">
        <style>background-image: url("/Assets/mvp-banner.png")</style>
      </div>
      <Anasayfa />
    </div>
  );
};
export default App;
